<STYLE type="text/css">
body {
background-color: #ffffff;
color: #222222;
margin : 0;
padding : 0;
}

TD{
  line-height : 160%;
}

/* Link */
a {
	color: #000ff;
}
a:hover {
	color: #FF0000;
}
a:active {
	color: #FF8000;
}
a:visited {
	color: #000080;
}

a:hover img {
 opacity: 0.7;
 filter: alpha(opacity=70);
 -moz-opacity: 0.7;
}

#feed li{
 float:none;
 padding: 0px 0px 2px 0px;
  width: 820px;
}

#small {
	font-size:10px;
	color:#333333;
	line-height:130%;
}

#syousai {
	font-size:13px;
	color:#333333;
	line-height:150%;
}

#syousai h2 {
    background:#eee;   
    border-right:10px solid #ff0000;   
    border-left:10px solid #ff0000;   
    padding:.8em .9em;  }

#syousai h3 {
    background:#eee;   
    border-top:1px solid #ccc;   
    border-right:1px solid #ccc;   
    border-left:7px solid #2b87e2;   
    border-bottom:1px solid #ccc;   
    padding:.8em .9em  
}   

#syousai h4 {
    border-bottom:2px solid #ccc;   
    border-left:4px solid #7f7f7f; 
    padding:.6em .8em  }
